  mounted () {
    Fun.init3D(this.$el, (Object3D) => {
      this.camera = Object3D.camera
      this.renderer = Object3D.renderer
      this.scene = Object3D.scene
      this.creatCube(Object3D.scene, Object3D.renderer, Object3D.camera)
    })
  },
  methods: {
    nextStep (space, callback) {
      // console.log('关闭盒子', auto)
      setTimeout(() => {
        this.step += space
        this.$emit('stepChange', this.step)
        // 判断是否暂停
        if (this.pause) {
          this.pause = false
        } else {
          callback(this.step)
        }
        this.renderScene()
      }, 20)
    },
    renderScene () {
      this.renderer.render(this.scene, this.camera)
    },
    getStep (step) {
      if (step < 0) {
        this.$emit('OpenFinish')
        console.log('动画已播放完毕!')
        return false
      }
      if (step > this.stepCount) {
        // 广播关闭完成事件
        this.$emit('CloseFinish')
        console.log('动画已播放完毕!')
        return false
      }
      const spiale = this.spiale
      if (step <= 90) {
        // 步骤一
        // 上下圆面贴合
        spiale[0].rotation.x = step * (Math.PI / 180)
        spiale[2].rotation.x = -step * (Math.PI / 180)
        // 平面变成直径为4的圆弧
        // 原点
        // 因为分为上下两个顶点所以要除2
        const vLength = this.meshs[1].geometry.vertices.length / 2
        // -----------------------------
        for (let i = 0; i <= vLength; i++) {
          if (i <= 40) {
            const Z = i * 0.05
            const X = Math.sqrt(4 - Math.pow(Z - 2, 2)) - (i * Math.PI / 40)
            this.meshs[1].geometry.vertices[i].z = Z / 90 * step
            this.meshs[1].geometry.vertices[i + 41].z = Z / 90 * step
            this.meshs[1].geometry.vertices[i].x = -Math.PI / 2 + i * Math.PI / 40 + step * X / 90
            this.meshs[1].geometry.vertices[i + 41].x = -Math.PI / 2 + i * Math.PI / 40 + step * X / 90
          }
        }
      } else if (step <= 135) {
        // 步骤二
        // 平面变成直径为2的圆弧
        const vLength = this.meshs[1].geometry.vertices.length / 2
        // -----------------------------
        for (let i = 0; i <= vLength; i++) {
          if (i <= 40) {
            const Z = i * 0.05
            const X = Math.sqrt(1 - Math.pow(Z - 1, 2)) - Math.sqrt(4 - Math.pow(Z - 2, 2))
            this.meshs[1].geometry.vertices[i].x = Math.sqrt(4 - Math.pow(Z - 2, 2)) - Math.PI / 2 + (step - 90) * X / 45
            this.meshs[1].geometry.vertices[i + 41].x = Math.sqrt(4 - Math.pow(Z - 2, 2)) - Math.PI / 2 + (step - 90) * X / 45
          }
        }
      } else if (step <= 225) {
        const ind = step - 135
        // 步骤二
        // 平面变成直径为2的圆弧
        const vLength = 41 // this.meshs[1].geometry.vertices.length / 2
        // -----------------------------
        for (let i = 0; i <= vLength; i++) {
          const Z = (i - 20) * 0.05
          const X = Math.sqrt(0.25 - Math.pow(Z - 0.5, 2)) - ((i - 20) * Math.PI / 40)
          this.meshs[1].geometry.vertices[i].z = this.stepSave[ind][i].z
          this.meshs[1].geometry.vertices[i + 40].z = this.stepSave[ind][i].z
          this.meshs[1].geometry.vertices[i].x = this.stepSave[ind][i].x
          this.meshs[1].geometry.vertices[i + 40].x = this.stepSave[ind][i].x
        }
        
      }
      this.meshs[1].geometry.verticesNeedUpdate = true
      return true
    },
    close (step) {
      if (this.getStep(step)) this.nextStep(1, this.close)
    },
    open (step) {
      if (this.getStep(step)) this.nextStep(-1, this.open)
    },
    dragClose (step) {
      if (this.getStep(step)) this.renderScene()
    },
    dragOpen (step) {
      if (this.getStep(step)) this.renderScene()
    },
    creatCube (scene, renderer, camera) {
      const geometry = new THREE.PlaneGeometry(Math.PI, 2, 40, 1)
      let cylinderGeometry = new THREE.CircleGeometry(0.5, 64, 0, 2 * Math.PI)
      // 定义6个颜色
      const colors = ['#64e530', '#ccaa1f', '#6b63ef']
      // 定义6个坐标
      const positions = [[0, 0.5, 0], [0, 0, 0], [0, -0.5, 0]]
      // 定义6个转轴
      const axiss = [[-Math.PI / 2, 1, 0], [0, 0, 0], [-Math.PI / 2, -1, 0]]
      // ----------------------------
      // 创造6个平面
      for (let index in colors) {
        // 取得颜色
        const color = colors[index]
        // 取得坐标
        const position = positions[index]
        // 取得转轴
        const axis = axiss[index]
        // 创建转轴
        this.spiale[index] = new THREE.Object3D()
        this.spiale[index].position.set(axis[0], axis[1], axis[2])
        this.scene.add(this.spiale[index])
        if (index === '0' || index === '2') {
          this.meshs[index] = new THREE.Mesh(cylinderGeometry, new THREE.MeshPhongMaterial({
            color: color,
            transparent: true,
            // 双面双面贴图
            side: THREE.DoubleSide
          }))
        } else if (index === '1') {
          this.meshs[index] = new THREE.Mesh(geometry, new THREE.MeshPhongMaterial({
            color: color,
            transparent: true,
            // 双面双面贴图
            side: THREE.DoubleSide
          }))
        }
        // 设置平面位置
        this.meshs[index].position.set(position[0], position[1], position[2])
        // 设置平面角度
        this.meshs[index].rotation.set(0, 0, 0)
        // 设置平面缩放
        this.meshs[index].scale.set(1, 1, 1)
        // 取消面剔除
        this.meshs[index].doubleSided = true
        this.meshs[index].castShadow = true
        // 将平面添加到场景中
        this.scene.add(this.meshs[index])
        this.spiale[index].add(this.meshs[index])
      }
      // 调试转轴
      // this.spiale[0].add(new THREE.AxesHelper(50))
      setTimeout(() => {
        this.renderScene()
      }, 0)
    }
  }
}
</script>
